com base no art.75, Inciso XV, da Lei 14.133/2021 e suas alterações:
Art. 75. É dispensável a licitação:
XV - para contratação de instituição brasileira que tenha por finalidade estatutária apoiar, captar e executar atividades de ensino, pesquisa, extensão, desenvolvimento institucional, científico e tecnológico e estímulo à inovação, inclusive para gerir administrativa e financeiramente essas atividades, ou para contratação de instituição dedicada à recuperação social da pessoa presa, desde que o contratado tenha inquestionável reputação ética e profissional e não tenha fins lucrativos;

Neste sentido, faz-se necessário a contratação de prestador especializado para execução dos  Serviços de:
Item 01) Retirada dos entulhos acumulados ao logo de diversos meses em local próximo ao Setor de transportes desta Regional,  e;
Item 2) Dedetização e Controle de Praga (Serpentes venenosas, Baratas, Formigas, Ratos, Cupins, etc.), no sentido de evitar a proliferação de insetos e animais peçonhentos, bem como a preservação da saúde de todos os servidores, estagiários e terceirizados que trabalham e acessam ao ambiente da Regional.
